Here's a simple function that takes a Date object representing the post time and returns the elapsed time in a human-readable format:

```typescript
function getElapsedTime(postTime: Date): string {
  const currentTime = new Date();
  const elapsedTime = currentTime.getTime() - postTime.getTime();

  const seconds = Math.floor((elapsedTime / 1000) % 60);
  const minutes = Math.floor((elapsedTime / (1000 * 60)) % 60);
  const hours = Math.floor((elapsedTime / (1000 * 60 * 60)) % 24);
  const days = Math.floor(elapsedTime / (1000 * 60 * 60 * 24));

  if (days > 0) {
    return `${days} day(s) ago`;
  }

  if (hours > 0) {
    return `${hours} hour(s) ago`;
  }

  if (minutes > 0) {
    return `${minutes} minute(s) ago`;
  }

  return `${seconds} second(s) ago`;
}
```

